import React, { Component } from "react";

export default class Child extends Component {
  render() {
    let { pName, pPrice, pCat } = this.props.product;
    return (
      
        <>
          <div className="card text-start col-md-3 ">
            <div className="card-body">
              <h2>{pName}</h2>
              <p>{pPrice}</p>
              <p>{pCat}</p>
            </div>
          </div>
        </>
      
    );
  }
}
